import { Link } from "react-router-dom";
import myFrends from "../data.js/myFrends";
const Frends = () => {
  return (
    <>
      <h1>Frends</h1>
      {Frends.map(myFrends => (
        <div key={myFrends.id}>
          <Link to={myFrends.slug} className="frendsLink">
            {myFrends.title}
          </Link>
        </div>
      ))}
    </>
  );
};

export default Frends;
